text:
ты исцеляешься каждый раз, когда: • поднимаешься с постели в ожидании чего-то волнительного;
• не думаешь о людях, которые покинули тебя; • убираешься в комнате и моешь всю посуду;
• улыбаешься себе и незнакомцам; • делаешь что-то доброе, чтобы осчастливить других;
• работаешь или встречаешься с друзьями, даже когда у тебя нет сил;
• успокаиваешь себя, когда мысли выходят из-под контроля;
• не забываешь выпить воды;
• не думаешь о вещах, которые не можешь контролировать;
• выбираешь лучшее для себя, даже если у тебя нет мотивации;
• говоришь себе, что перерастёшь это и не будешь страдать вечно. .
.
.
